        private static string GetMimeTypeInternal(string extension)
        {
            switch (extension)
            {
                // Lotus 1-2-3 spreadsheet
                case _123:
                case wk1:
                case wk3:
                case wk4:
                case wks:
                    return applicationvndlotus123;
                // Genesis 32X ROM
                case _32x:
                case mdx:
                    return applicationxgenesis32xrom;
                case _3dml:
                    return textvndin3d3dml;
                // 3D Studio image
                case _3ds:
                    return imagex3ds;
                // 3GPP2 multimedia file
                case _3g2:
                case _3gp2:
                case _3gpp2:
                    return video3gpp2;
                // 3GPP multimedia file
                case _3gp:
                case _3gpp:
                case _3ga:
                    return video3gpp;
                // T602 document
                case _602:
                    return applicationxt602;
                // 7-zip archive
                case _7z:
                    return applicationx7zcompressed;
                // AR archive
                case a:
                case ar:
                    return applicationxarchive;
                // Atari 2600
                case a26:
                    return applicationxatari2600rom;
                // Atari 7800
                case a78:
                    return applicationxatari7800rom;
                case aab:
                case u32:
                case vox:
                case x32:
                    return applicationxauthorwarebin;
                // AAC audio
                case aac:
                    return audioaac;
                case aam:
                    return applicationxauthorwaremap;
                case aas:
                    return applicationxauthorwareseg;
                // AbiWord document
                case abw:
                case abwcrashed:
                case abwgz:
                case zabw:
                    return applicationxabiword;
                // Dolby Digital audio
                case ac3:
                    return audioac3;
                case acc:
                    return applicationvndamericandynamicsacc;
                // ACE archive
                case ace:
                    return applicationxace;
                case acu:
                    return applicationvndacucobol;
                case acutc:
                case atc:
                    return applicationvndacucorp;
                // Ada source code
                case adb:
                case ads:
                    return textxadasrc;
                // Amiga disk image
                case adf:
                    return applicationxamigadiskformat;
                case adp:
                    return audioadpcm;
                case aep:
                    return applicationvndaudiograph;
                // Adobe font metrics
                case afm:
                    return applicationxfontafm;
                case afp:
                case list3820:
                case listafp:
                    return applicationvndibmmodcap;
